con:config.script:
def date= System.currentTimeMillis()

def step = "FetchJSON";

if (date%2==0){
	step="FetchXML";
}
if (date%7==0){
	step="401Unauthorized";
}
testRunner.runTestStepByName(step)

testRunner.gotoStepByName("Delay")

log.info "goto took="+(System.currentTimeMillis()-date)

